import Link from "next/link";

const titleBarStyle = {
  padding: 20,
};

const TitleBar = (props) => (
  <div style={titleBarStyle}>
    <h3>{props.title}</h3>
    <img src="./resources/medstar-health.png" />
  </div>
);

export default TitleBar;
